// Home.js
import React from "react";
import Image from "../image/bureau.png";
import { useNavigate } from "react-router-dom";
import "../component/Nav";

function Home() {
  const navigate = useNavigate();

  const Display = () => {
    navigate("/Display");
  };
  const Keyboard = () => {
    navigate("/Keyboard");
  };
  const Time = () => {
    navigate("/Time");
  };
  const Mouse = () => {
    navigate("/Mouse");
  };
  const Lamp = () => {
    navigate("/Lamp");
  };
  const handleMouseEnter = () => {
    document.body.style.cursor = "pointer"; // Change cursor to pointer
  };

  const handleMouseLeave = () => {
    document.body.style.cursor = "default"; // Reset cursor to default
  };

  return (
    <>
      <img src={Image} className="Desktop" useMap="#image-map" alt="" />
      <map name="image-map">
        <area
          target="Screen"
          alt="Display"
          title="Display"
          coords="263,131,260,157,344,157,338,131,409,131,421,52,177,54,192,131"
          shape="poly"
          onClick={Display}
          onMouseEnter={handleMouseEnter}
          onMouseLeave={handleMouseLeave}
        />
        <area
          target="Keyboard"
          alt="Keyboard"
          title="Keyboard"
          coords="249,228,367,171"
          shape="rect"
          onClick={Keyboard} // Call the navigation function on click
          onMouseEnter={handleMouseEnter}
          onMouseLeave={handleMouseLeave}
        />
        <area
          className="Time"
          target="Time"
          alt="Time"
          title="Time"
          coords="445,246,24"
          shape="circle"
          onClick={Time}
          onMouseEnter={handleMouseEnter}
          onMouseLeave={handleMouseLeave}
        />
        <area
          target="Mouse"
          alt="Mouse"
          title="Mouse"
          coords="401,175,389,180,389,217,402,225,415,217,415,181"
          shape="poly"
          onClick={Mouse}
          onMouseEnter={handleMouseEnter}
          onMouseLeave={handleMouseLeave}
        />
        <area
          target="Lamp"
          alt="Lamp"
          title="Lamp"
          coords="156,69,105,24,93,26,86,22,85,37,84,92,93,90,88,50,123,96,132,92,145,81"
          shape="poly"
          onClick={Lamp}
          onMouseEnter={handleMouseEnter}
          onMouseLeave={handleMouseLeave}
        />
      </map>
    </>
  );
}

export default Home;
